import React from "react";

export default function Table({ releasesData }) {
  console.log(releasesData);
  return (
    <div className="Table">
      <input
        type="text"
        id="myInput"
        placeholder="Search for names.."
        title="Type in a name"
      ></input>
      <table id="myTable">
        <tbody>
          <tr className="header">
            <th style={{ width: "20%" }}>Label</th>
            <th style={{ width: "20%" }}>Title</th>
            <th style={{ width: "20%" }}>Track Info</th>
            <th style={{ width: "10%" }}>Year</th>
          </tr>
          {releasesData.map((song) => {
            return (
              <tr>
                <td>{song.label}</td>
                <td>{song.title}</td>
                <td>{song.trackinfo}</td>
                <td>{song.year}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}
